function getSubNav(pathHead){
    const navItem= {
        pathHead,
        navList:[
            {path:`/${pathHead}/list`,key:`topNav/${pathHead}/list`,'title':`${pathHead} List`},
            {path:`/${pathHead}/add`,key:`topNav/${pathHead}/add`,'title':`Add ${pathHead}`},
            {path:`/${pathHead}/upload`,key:`topNav/${pathHead}/upload`,'title':`Upload ${pathHead} Spreadsheet`},
        ]
    }
    return navItem
} 
const studentsNav= getSubNav('students')
const schoolssNav= getSubNav('schools')
const volunteersNav= getSubNav('volunteers')
const eventsNav= getSubNav('events')
const usersNav= getSubNav('users')

console.log(studentsNav)

export{studentsNav,schoolssNav,volunteersNav,eventsNav,usersNav}
